import React from 'react';
import About from './About';
import ContactUs from './ContactUs';
import  { Routes, Route } from 'react-router-dom';

const App = () => {
  return (
     <>
      <Routes>
        <Route path='/' Component={About}/>
      </Routes>
     </>
  );
};

export default App;
